#include <Ethernet.h>
#include <EthernetClient.h>
#include <EthernetServer.h>

byte mac[] = { 0xDE, 0xAD, 0xBE, 0xEF, 0xFE, 0xED };s
IPAddress ip(192, 168, 0, 177);  
EthernetServer server(80);

int ledPin = 8; 

void setup() {
  Ethernet.begin(mac, ip);
  server.begin();
  pinMode(ledPin, OUTPUT);
}

void loop() {
  EthernetClient client = server.available();

  if (client) {
    boolean currentLineIsBlank = true;
    while (client.connected()) {
      if (client.available()) {
        char c = client.read();
        if (c == '\n' && currentLineIsBlank) {
          // Send a simple HTML page to the browser
          client.println("HTTP/1.1 200 OK");
          client.println("Content-Type: text/html");
          client.println();
          client.println("<html><body>");
          client.println("<h1>Arduino Web Control</h1>");
          client.println("<a href='/on'>Turn On</a><br>");
          client.println("<a href='/off'>Turn Off</a><br>");
          client.println("</body></html>");
          break;
        }
        if (c == '\n') {
          currentLineIsBlank = true;
        }
        else if (c != '\r') {
          currentLineIsBlank = false;
        }
      }

      if (client.find("GET /on")) {
        digitalWrite(ledPin, HIGH);  // Turn on the LED
      }
      if (client.find("GET /off")) {
        digitalWrite(ledPin, LOW);  // Turn off the LED
      }
    }
    delay(1);
    client.stop();
  }
}

