#ifndef TCPSERVER_H
#define TCPSERVER_H

#include <iostream>
#include "boost/asio.hpp"

class TCPServer {
public:
    TCPServer(boost::asio::io_service& ioService, int port, std::string name) :
            acceptor(ioService, boost::asio::ip::tcp::endpoint(boost::asio::ip::tcp::v4(), port)),
            conName(std::move(name))
    {}

    [[noreturn]] void startServer();

    void handleClientConnection(boost::asio::ip::tcp::socket clientSocket);


    ~TCPServer() {
        // Закрываем акцептор при завершении
        acceptor.close();
    }

private:
    boost::asio::ip::tcp::acceptor acceptor;
    std::string conName;
};

#endif //TCPSERVER_H



//----------------------------------------------------- CPP --------------------------------------------------------//
#include "tcpserver.h"

[[noreturn]] void TCPServer::startServer() {
    while (true) {
        boost::asio::ip::tcp::socket clientSocket(acceptor.get_executor());
        acceptor.accept(clientSocket);

        // Запускаем новый поток для обработки соединения с клиентом
        std::thread(&TCPServer::handleClientConnection, this, std::move(clientSocket)).detach();
    }
}

void TCPServer::handleClientConnection(boost::asio::ip::tcp::socket clientSocket) {
    try {
        // В цикле читаем данные из сокета и выводим их на печать
        while (true) {
            std::vector<char> buffer(1024);
            boost::system::error_code error;
            std::size_t bytesRead = clientSocket.read_some(boost::asio::buffer(buffer), error);

            if (error == boost::asio::error::eof) {
                break;
            } else if (error) {
                throw boost::system::system_error(error);
            }

            // Выводим прочитанные данные
            std::cout << "Received data from client " << conName << ": " <<
                      std::string(buffer.begin(), buffer.begin() + static_cast<int>(bytesRead)) << std::endl;
        }
    } catch (const std::exception& e) {
        std::cerr << "Exception in handleClientConnection: " << e.what() << std::endl;
    }

    // Закрываем сокет клиента
    clientSocket.close();
}

