#include <thread>
#include <boost/asio.hpp>

#include "tcpserver.h"

using namespace boost::asio;
using ip::tcp;


int main() {
    io_service ioService;

    TCPServer clientServer(ioService, 8080, "Server1");
    TCPServer otherServer(ioService, 9090, "Server2");

    // Запускаем серверы в отдельных потоках
    std::thread clientThread([&]() { clientServer.startServer(); });
    std::thread otherThread([&]() { otherServer.startServer(); });

    // Запускаем службу ввода-вывода
    ioService.run();

    // Ждем завершения работы потоков
    clientThread.join();
    otherThread.join();

    return 0;
}

