use std::sync::Arc;

use tokio::{io::AsyncWriteExt, net::tcp::OwnedWriteHalf, sync::Mutex};

use crate::{queries::select_query, state, structs};

pub async fn select(
    write: Arc<Mutex<OwnedWriteHalf>>,
    command: structs::CommandData,
    user: Arc<Mutex<state::ClientState>>,
    keyspace: Option<String>,
    table: Option<String>,
) {
    let mut write = write.lock().await;
    let mut user = user.lock().await;

    if !user.connected {
        let response = "Not connected to scylla";

        write.write_all(response.as_bytes()).await.unwrap();

        write.shutdown().await.unwrap();

        return;
    }

    match command {
        structs::CommandData::Select(select_data) => {
            let query = select_query(
                keyspace.to_owned().unwrap(),
                table.to_owned().unwrap(),
                select_data,
            );

            println!("query: {:?}", query);

            let session = user.session.as_ref().unwrap().lock().await;

            let rows = session.query(query.query, query.values).await.unwrap();

        }

        _ => {
            println!("Unknown command data: {:?}", command);
        }
    }
}

use serde::{Deserialize, Serialize};
use std::collections::HashMap;
 
#[derive(Debug, Deserialize, Serialize)]
pub struct SelectData {
    #[serde(rename = "where")]
    pub where_clause: HashMap<String, Value>,
    pub columns: Vec<String>,
    pub limit: u32,
}
 
#[derive(Debug, Deserialize, Serialize)]
#[serde(untagged)]
pub enum Value {
    Str(String),
    Bool(bool),
    Num(f64),
    Array(Vec<Value>),
}
  
#[derive(Debug)]
pub struct Query {
    pub query: String,
    pub values: Vec<Value>,
}
 
pub fn select_query(keyspace: String, table: String, data: SelectData) -> Query {
    let mut query = String::from("SELECT ");
 
    let mut values = Vec::new();
 
    let mut columns = Vec::new();
 
    for column in data.columns {
        columns.push(column);
    }
 
    query.push_str(&columns.join(", "));
 
    query.push_str(" FROM ");
 
    query.push_str(keyspace.as_str());
 
    query.push_str(".");
 
    query.push_str(table.as_str());
 
    query.push_str(" WHERE ");
 
    let mut where_clause = Vec::new();
 
    for (key, value) in data.where_clause {
        where_clause.push(format!("{} = ?", key));
 
        values.push(value);
    }
 
    query.push_str(&where_clause.join(" AND "));
 
    query.push_str(" LIMIT ");
 
    query.push_str(&data.limit.to_string());
 
    Query {
        query,
        values,
    }
}

